import Auth from './auth/Auth';

// A wrapper for <Route> that redirects to the login
// screen if you're not yet authenticated.
export default function PrivateRoute({ children, ...rest }) {
    let auth = Auth;
    return (
      <Route
        {...rest}
        render={({ location }) =>
          auth.getAuth() ? (
            children
          ) : (
            <Redirect
              to={{
                pathname: "/login",
                state: { from: location }
              }}
            />
          )

        }
      />
    );
  }
